    public static int numJewelsInStones(String J, String S) {
        int count = 0;
        for (int i = 0; i < J.length(); i++) {
            for (int j = 0; j < S.length(); j++) {
                if (J.charAt(i) == S.charAt(j)) count++;
            }
        }
        return count;
    }

    public boolean lemonadeChange(int[] bills) {
        int fiveDollar = 0;
        int tenDollar = 0;
        for (int i = 0; i < bills.length; i++) {
            if (bills[i] == 5) {
                fiveDollar++;
            } else if (bills[i] == 10) {
                if (fiveDollar > 0) {
                    fiveDollar--;
                    tenDollar++;
                } else {
                    return false;
                }
            } else {
                if (fiveDollar >= 3) {
                    fiveDollar -= 3;
                } else if (tenDollar > 0 && fiveDollar > 0) {
                    tenDollar--;
                    fiveDollar--;
                } else return false;

            }

        }
        return true;
    }

    public static List<String> fizzBuzz(int n) {
        List<String> str = new ArrayList();
        for (int i = 1; i <= n; i++) {
            boolean dev3 = (i % 3 == 0);
            boolean dev5 = (i % 5 == 0);

            if (dev5 && dev3) {
                str.add("FizzBuzz");

            } else if (dev3) {
                str.add("Fizz");
            } else if (dev5) {
                str.add("Buzz");
            } else {
                str.add(Integer.toString(i));
            }
        }
        return str;
    }

