    public static int thirdMax(int[] nums) {
        Integer firstMaximum = null;
        Integer secondMaximum = null;
        Integer thirdMaximum = null;
        for (int i = 0; i < nums.length; i++) {
            if (firstMaximum == null || nums[i] > firstMaximum) {
                thirdMaximum = secondMaximum;
                secondMaximum = firstMaximum;
                firstMaximum = nums[i];
            } else if (nums[i] == firstMaximum) {
                continue;
            } else if (secondMaximum == null || nums[i] > secondMaximum) {
                thirdMaximum = secondMaximum;
                secondMaximum = nums[i];
            } else if (nums[i] == secondMaximum) {
                continue;
            } else if (thirdMaximum == null || nums[i] > thirdMaximum) {
                thirdMaximum = nums[i];
            }
        }
        if (thirdMaximum == null) {
            return firstMaximum;
        } else {
            return thirdMaximum;
        }
    }


