    public static void reverseString(char[] s) {
        if (s.length == 0) {
            return;
        }
        int l = 0;
        int r = s.length - 1;

        do {
            int a = s[l];
            int b = s[r];
            a = a + b;
            b = a - b;
            a = a - b;
            s[l] = (char) a;
            s[r] = (char) b;
            r--;
            l++;
        } while (l < r);
    }

    public static boolean isPalindrome(String s) {
        if (s == null || s.length() == 0) return true;
        StringBuilder alphnum = new StringBuilder();

        for (int i = 0; i < s.length(); i++) {
            char a = s.charAt(i);
            if (47 < a && a < 58) {
                alphnum.append(a);
            } else if (64 < a && a < 91) {
                alphnum.append(a);
            } else if (96 < a && a < 123) {
                alphnum.append(a);
            } else {
                continue;
            }
        }


        int l = 0, r = alphnum.length() - 1;
        while (l < r) {
            char a = alphnum.charAt(l);
            char b = alphnum.charAt(r);


            if ((a - b) == 0) {
                l++;
                r--;
            } else if (Character.forDigit(a - 32, 16) == Character.forDigit(b, 16)) {
                l++;
                r--;
            } else if (Character.forDigit(a + 32, 16) == Character.forDigit(b, 16)) {
                l++;
                r--;
            } else {
                return false;
            }
        }

        return true;
    }

    public static int findLengthOfLCIS(int[] nums) {
        int temp = 0;
        int sum = 1;
        if (nums.length == 0) return 0;

        for (int i = 0; i < nums.length - 1; i++) {
            if (nums[i] < nums[i + 1]) {
                sum += 1;
            } else {
                temp = Math.max(temp, sum);
                sum = 1;
            }
        }
        temp = Math.max(temp, sum);
        return temp;
    }

    public static int countSubstrings(String s) {
        int len = s.length();
        int ssize = 1;
        List<String> strArray = new ArrayList<>();
        while (ssize <= s.length()) {
            int a = 0;
            for (int j = 0; j < ssize; j++) {
                StringBuilder builder = new StringBuilder();
                for (int i = a; i < a + len; i++) {
                    builder.append(s.charAt(i));
                }
                a++;
                strArray.add(builder.toString());
            }
            ssize++;
            len--;
        }
        int count = 0;
        for (String str : strArray) {
            int check = 0;
            if (str.length() > 1) {
                int l = 0;
                int r = str.length() - 1;
                while (l < r) {
                    if (str.charAt(l) == str.charAt(r)) {
                        check++;
                    }
                    l++;
                    r--;
                }
            }
            if (check == (str.length() / 2)) {
                count++;
            }
        }

        return count;
    }

    public static int countSubstrings1(String s) {
        int n = s.length();
        if (n < 2)
            return n;
        int count = n;
        boolean[][] dp = new boolean[n][n];
        // size 1 substrings are palindromes
        for (int i = 0; i < n; i++)
            dp[i][i] = true;
        // for size 2 substrings, check first and last char
        for (int i = 0; i + 1 < n; i++)
            if (s.charAt(i) == s.charAt(i + 1)) {
                dp[i][i + 1] = true;
                count++;
            }
        // for size = 3+
        for (int len = 2; len < n; len++) // controls the size of the substring
            for (int i = 0; i + len < n; i++) { // controls the start index
                int j = i + len; // end index
                if ((s.charAt(i) == s.charAt(j)) && dp[i + 1][j - 1]) {
                    dp[i][j] = true;
                    count++;
                }
            }
        return count;
    }

    public static List<List<Integer>> generate(int numRows) {
        List<List<Integer>> finalArr = new ArrayList<List<Integer>>();
        for (int i = 0; i < numRows; i++) {
            List<Integer> subNums = new ArrayList<Integer>();
            for (int j = 0; j <= i; j++) {
                if (i == 0 && j == 0) {
                    subNums.add(1);
                } else if (j == 0) {
                    subNums.add(1);
                } else if (j == i) {
                    subNums.add(1);
                } else {
                    subNums.add(finalArr.get(i - 1).get(j - 1) + finalArr.get(i - 1).get(j));

                }
            }
            finalArr.add(subNums);
        }
        return finalArr;
    }

